// Order.js
import React from 'react';

const Order = (props) => {
  const { cartItems } = props.location.state;

  // Use cartItems data in your Order component
  // For example:
  console.log(cartItems);

  return (
    <div>
      {/* Your Order component JSX */}
      <h2>Ordered Items</h2>
      <ul>
        {cartItems.map(item => (
          <li key={item.id}>
            <p>Name: {item.name}</p>
            <p>Price: ${item.price}</p>
            {/* Add more details if needed */}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Order;
